Defendant Traveon D Leavell in court with attorney Bernard S. Stein.  Defendant Traveon D Leavell in custody.  Sara Nicole Volden Schroeder appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.  The Court imposed the following sentence:

AS TO COUNT 01:
The Court imposed but stayed 9 months in the House of Correction, with credit for 78 days time served.  Court STAYED said sentence and placed defendant on probation for 24 months.
 * Court ordered defendant to provide a DNA sample.

AS TO COUNT 02:
The Court imposed but stayed 9  months in the House of Correction, consecutive to Count 1, and placed defendant probation for 24 months concurrent to Count 1. 
 * DNA sample ordered in Count 1.

CONDITIONS OF PROBATION:
 - No controlled substances or alcohol;
 - Urine screens;
 - AODA assessment and treatment if needed;
 - No contact with Emaunel D.;
 - No contact with co-defendant Tori Leavell;
 - Anger management counseling;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Pay restitution to Emanuel D. in the stipulated amount of  $345.00, joint and several, with co-defendant in case 15CF2101, plus the DNA surcharges in Counts 1 and 2, plus the costs and disbursements.  Failure to pay would result in a civil judgment entered against defendant.

